import React, { Component } from "react";
import logo from "../untied_logo.png";

class TaxCalculator extends Component {
  state = {};
  render() {
    return (
      <React.Fragment>
        <div className="logoDiv">
          <img src={logo} className="logo" />
        </div>
        <div className="mainDiv">
          <h1>Welcome to the Untied tax calculator</h1>
          <h2>
            We can calculate your take home pay after tax or what salary you
            need to ask for to acheive a desired take home pay
          </h2>
          <h3>First, select which tax year you want</h3>
          <input type="radio" id="male" name="gender" value="male" />
          <label for="male">Male</label>
          <br>
            <input type="radio" id="female" name="gender" value="female" />
            <label for="female">Female</label>
          </br>
        </div>
      </React.Fragment>
    );
  }
}

export default TaxCalculator;
